import React from 'react';
import './Gallery.css';
import groupPhoto from '../assets/images/group-photo.jpg';
import groupPhoto2 from '../assets/images/group-photo2.jpg';
import groupPhoto3 from '../assets/images/group-photo3.jpg';

// Use group photos as temporary placeholders for walk images
const walk1 = groupPhoto;
const walk2 = groupPhoto2;
const walk3 = groupPhoto3;
const walk4 = groupPhoto;
const walk5 = groupPhoto2;
const walk6 = groupPhoto3;
const walk7 = groupPhoto;
const walk8 = groupPhoto2;
const walk9 = groupPhoto3;
const walk10 = groupPhoto;

function Gallery() {
  const galleryImages = [
    {
      id: 1,
      src: groupPhoto,
      title: 'August 93 Club Members - Group Photo',
      description: 'Our dedicated members in official polo shirts'
    },
    {
      id: 2,
      src: groupPhoto2,
      title: 'Annual General Meeting',
      description: 'AGM 2024 - Planning for the future'
    },
    {
      id: 3,
      src: groupPhoto3,
      title: 'Community Outreach',
      description: 'Service for advancement in action'
    },
    {
      id: 4,
      src: walk1,
      title: 'Community Walk (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 5,
      src: walk2,
      title: 'Health Awareness Walk (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 6,
      src: walk3,
      title: 'Unity Walk 2024 (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 7,
      src: walk4,
      title: 'Morning Fitness Session (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 8,
      src: walk5,
      title: 'Walk for Progress (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 9,
      src: walk6,
      title: 'Community Bonding Walk (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 10,
      src: walk7,
      title: 'Health Walk Initiative (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 11,
      src: walk8,
      title: 'Annual Fitness Walk (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 12,
      src: walk9,
      title: 'Walk for Solidarity (Placeholder)',
      description: 'Walk image coming soon'
    },
    {
      id: 13,
      src: walk10,
      title: 'Final Walk Session (Placeholder)',
      description: 'Walk image coming soon'
    }
  ];

  return (
    <div className="gallery">
      <div className="gallery-hero">
        <h1>Our Gallery</h1>
        <p>Moments and memories from August 93 Club - Ohanze Congress</p>
      </div>

      <div className="container">
        <div className="gallery-grid">
          {galleryImages.map((image) => (
            <div key={image.id} className="gallery-item">
              <div className="gallery-image">
                <img src={image.src} alt={image.title} />
                <div className="gallery-overlay">
                  <h3>{image.title}</h3>
                  <p>{image.description}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Gallery;
